import React, { Component } from 'react';
import './aboutme.css';
import { Grid, Cell} from 'react-mdl';

class About extends Component {
    render(){
        return(
            <div>
                <Grid>
                <Cell className="left-about" col={4}>hi</Cell>
                <Cell className="right-about" col={8}>hi</Cell>
                </Grid>
            </div>
        )
    }
}

export default About;
